    <script>
        const listinha = [];


        $(".tolfix").click(function() {
            listinha[this.id] = true;

            var id = this.id

            $(`#${this.id}-front-man`).animate({
                opacity: 0.3
            }, 300, function() {
                setTimeout(function() {
                    $(`#${id}-descricao`).animate({
                        zIndex: 1
                    }, "slow")
                }, 400);

            });

            $(this).css("box-shadow", "0px 0px 31px 9px rgba(45, 125, 138, 0.48)");
            $(this).css("cursor", "default");
            var styles = {
                backgroundImage: 'url("../database/bermuda-square.svg")',
                backgroundRepeat: "no-repeat",
                backgroundSize: "100%"
            };
            $(this).css(styles).animate({
                opacity: '0.9'
            }, "slow").animate({
                opacity: '1'
            }, "slow");


        })


        $(".tolfix").hover(
            function() {
                if (!listinha[this.id]) {
                    //$(this).append($("<span> *** AAAAAAAAAAAAAAAAAAAAAAAAAA</span>"));
                    $(this).css("box-shadow", "0px 0px 31px 9px rgba(252, 255, 41, 0.48)");
                }
            },
            // -webkit-box-shadow: 0px 0px 31px 9px rgba(252, 255, 41, 0.48);
            // box-shadow: 0px 0px 31px 9px rgba(252, 255, 41, 0.48);
            function() {
                if (!listinha[this.id]) {
                    $(this).css("box-shadow", "none");
                }
            }
